                {/* Aside */}
                <div className="aside">
                    Aside
                </div>
                {/* Aside */}
                {/* Main content */}
                <div className="main-content">
                    <section className="home section">
                        Home
                    </section>
                </div>
                {/* Main content */}
            </div>

            {/* Main component */}
        </div>
    );
}
export default Menu;
